import MessageBubble from "../message-bubble";
export default {
  name: 'FaceElement',
  props: {
    payload: {
      type: Object,
      required: true
    },
    message: {
      type: Object,
      required: true
    },
    isMine: {
      type: Boolean
    }
  },
  components: {
    MessageBubble: MessageBubble
  },
  computed: {
    url: function url() {
      var name = '';

      if (this.payload.data.indexOf('@2x') > 0) {
        name = this.payload.data;
      } else {
        name = this.payload.data + '@2x';
      }

      return "https://webim-1252463788.file.myqcloud.com/assets/face-elem/".concat(name, ".png");
    }
  }
};
